import React, { Component } from 'react';

class Table extends Component {
  state = {
    items: []
  }

  componentDidMount() {
    fetch('http://localhost:3000/items')
      .then((response) => {
        return response.json();
      })
      .then((items) => {
        this.setState({ items: items })
      })
  }

  render() {
    return (
      <div className="table">

      </div>
    );
  }

}

export default Table;
